// import logo from './logo.svg';
import './App.css';
import { useState } from 'react';
// import { flushSync } from 'react-dom';

function Square({ value, onSquareClick, color }) {
  return (
    <button
      className="square"
      onClick={onSquareClick}
      style={{ color: color }}
    >
      { value }
    </button>
  );
}

export default function Board() {
  const [xIsNext, setXIsNext] = useState(true);
  const [squares, setSquares] = useState(Array(9).fill(null));
  const [color, setColor] = useState("red");

  function calculateWinner(squares) {
    const winningLines = [
      // connect 4 horizontally
      [0, 1, 2, 3],
      [1, 2, 3, 4],
      [2, 3, 4 ,5],
      [3, 4, 5, 6],
      [7, 8, 9, 10],
      [8, 9, 10, 11],
      [9, 10, 11 ,12],
      [10, 11, 12, 13],
      [14, 15, 16, 17],
      [15, 16, 17, 18],
      [16, 17, 18 ,19],
      [17, 18, 19, 20],
      [21, 22, 23, 24],
      [22, 23, 24, 25],
      [23, 24, 25 ,26],
      [24, 25, 26, 27],
      [28, 29, 30, 31],
      [29, 30, 31, 32],
      [30, 31, 32 ,33],
      [31, 32, 33, 34],
      [35, 36, 37, 38],
      [36, 37, 38, 39],
      [37, 38, 39 ,40],
      [38, 39, 40, 41],
      // connect 4 vertically
      [0, 7, 14, 21],
      [7, 14, 21, 28],
      [14, 21, 28, 35],
      [1, 8, 15, 22],
      [8, 15, 22, 29],
      [15, 22, 29, 36],
      [2, 9, 16, 23],
      [9, 16, 23, 30],
      [16, 23, 30, 37],
      [3, 10, 17, 24],
      [10, 17, 24, 31],
      [17, 24, 31, 38],
      [4, 11, 18, 25],
      [11, 18, 25, 32],
      [18, 25, 32, 39],
      [5, 12, 19, 26],
      [12, 19, 26, 33],
      [19, 26, 33, 40],
      [6, 13, 20, 27],
      [13, 20, 27, 34],
      [20, 27, 34, 41],
      // connect 4 diagonally
      [0, 8, 16, 24],
      [1, 9, 17, 25],
      [2, 10, 18, 26],
      [3, 11, 19, 27],
      [7, 15, 23, 31],
      [8, 16, 24, 32],
      [9, 17, 25, 33],
      [10, 18, 26, 34],
      [14, 22, 30, 38],
      [15, 23, 31, 39],
      [16, 24, 32, 40],
      [17, 25, 33, 41],
      [3, 9, 15, 21],
      [4, 10, 16, 22],
      [5, 11, 17, 23],
      [6, 12, 18, 24],
      [10, 16, 22, 28],
      [11, 17, 23, 29],
      [12, 18, 24, 30],
      [13, 19, 25, 31],
      [17, 23, 29, 35],
      [18, 24, 30, 36],
      [19, 25, 31, 37],
      [20, 26, 32, 38],
    ];
    for (let i = 0; i < winningLines.length; i++) {
      const [a, b, c, d] = winningLines[i];
      if (squares[a] && squares[a] === squares[b] && squares[a] === squares[c] && squares[a] === squares[d]) {
        return squares[a];
      }
    }

    // check for a tie
    for (let i = 0; i < squares.length; i++) {
      if (!squares[i]) return null;
    }
    return "tie";
  }

  function handleClick(i) {
    if (squares[i] || calculateWinner(squares)) return; // if square is already filled, return (do nothing
    const nextSquares = squares.slice();
    if (xIsNext) {
      nextSquares[i] = "X";
    } else {
      nextSquares[i] = "O";
    }
    setColor(xIsNext ? "blue" : "red")
    // mimic gravity for board
    for (let j = 0; j <= 41; j++) {
      if (!nextSquares[j]) {
        if (j - 7 >= 0 && nextSquares[j - 7]) {
          nextSquares[j] = nextSquares[j - 7];
          nextSquares[j - 7] = null;
        }
      }
    }

    setSquares(nextSquares);
    setXIsNext(!xIsNext);
  }

  const winner = calculateWinner(squares);
  let status;
  if (winner && winner !== "tie") {
    status = "Winner: " + winner;
  } else if (winner === "tie") {
    status = "Tie game!";
  } else {
    status = "Next player: " + (xIsNext ? "X" : "O");
  }

  // Connect four board is 7x6
  return (
  <>
    <div className='status'>{ status }</div>
    <div className='board-row'>
      <Square value={ squares[0] } onSquareClick={() => handleClick(0)} color={ color }/>
      <Square value={ squares[1] } onSquareClick={() => handleClick(1)} color={ color }/>
      <Square value={ squares[2] } onSquareClick={() => handleClick(2)} color={ color }/>
      <Square value={ squares[3] } onSquareClick={() => handleClick(3)} color={ color }/>
      <Square value={ squares[4] } onSquareClick={() => handleClick(4)} color={ color }/>
      <Square value={ squares[5] } onSquareClick={() => handleClick(5)} color={ color }/>
      <Square value={ squares[6] } onSquareClick={() => handleClick(6)} color={ color }/>
    </div>
    <div className='board-row'>
      <Square value={ squares[7] } onSquareClick={() => handleClick(7)} color={ color }/>
      <Square value={ squares[8] } onSquareClick={() => handleClick(8)} color={ color }/>
      <Square value={ squares[9] } onSquareClick={() => handleClick(9)} color={ color }/>
      <Square value={ squares[10] } onSquareClick={() => handleClick(10)} color={ color }/>
      <Square value={ squares[11] } onSquareClick={() => handleClick(11)} color={ color }/>
      <Square value={ squares[12] } onSquareClick={() => handleClick(12)} color={ color }/>
      <Square value={ squares[13] } onSquareClick={() => handleClick(13)} color={ color }/>
    </div>
    <div className='board-row'>
